        if (action.type == 'ageIncrement') {
            age = state.age + 1;
        }
        throw Error('Unknown action.');
    }

    return (
        <div>
            <button
                onClick={() => {
                    dispatch({ type: 'ageIncrement' })
                }}
                className='p-2 m-2'>
                Increment
            </button>
            <ButtonList />
            <VideoContainer />
        </div>
    )
}

